import React from "react";
import Card from './Card';

const CardList = ({ pokedex }) => {
    return (
        <div>
            {
                pokedex.map((user,i) => {
                    return (
                        <Card 
                            key={i} 
                            id={pokedex[i].id} 
                            name={pokedex[i].name} 
                            num={pokedex[i].num} 
                        />
                    );
                })
            }
        </div>
    )
} 

export default CardList;
